'<p>',
'Google Maps allows a maximum of 8 waypoints in addition to the origin and destination.',
'<p>',
'The Directions Panel is an ordinary APEX region with the following contents:',
'<code>',
'    &lt;div id="directionspanel">&lt;/div>',
'</code>',
