'<p>',
'A dynamic action on the region responds to the "directions" event with this javascript:',
'<code>',
'    $s("P11_DISTANCE",this.data.distance);',
'    $s("P11_DURATION",this.data.duration);',
'    $s("P11_LEGS",this.data.legs);',
